  <head>
    <meta charset="UTF-8"/>
    <title></title>
    <style type="text/css">
    body {
      font-family: helvetica;
    }
    svg#map {
      background-image: url('map.png');
      background-repeat: no-repeat;
      background-size: 100%;
    }
    svg#map path {
      fill-opacity: 0;
      stroke-opacity: 0;
      cursor: pointer;
    }
    svg#map path:not(.selected):hover {
      fill-opacity: 0.5;
    }
    svg#map path.selected {
      fill-opacity: 0.7;
    }
    svg#map {
      float: left;
      width: 50%;
      /*min-width: 200px;*/
    }
    #mapInfo {
      float: right;
      max-width: 50%;
    }
    #mapInfo .content {
      border: 2px solid black;
      margin: 1em 0;
    }
    #mapInfo .content:after {
      content: ' ';
      display: table;
      clear: both;
    }

    #useType:not(:empty):before {
      content: " - ";
    }
    #useTypeHeader {
      float: left;
    }
    #useTypeCode {
      float: right;
      min-width: 3em;
      text-align: center;
    }

    ._x33_\.1 #useTypeCode {
      background: #d64e00;
    }
    ._x32_\.1 #useTypeCode {
      background: #1a71b8; 
      color: white;
    }

    #mapInfo .header, #mapInfo header {
      font-weight: bold;
    }
    #mapInfo header {
      margin-bottom: -1em;
    }
    #mapInfo ul {
      padding-left: 0;
    }
    #mapInfo li {
      list-style-type: none;
      margin: 0.5em 0;
    }

    </style>

    <script type="text/javascript">
    (function ($) {
      // polyfill Array
      if (!Array.isArray) {
        Array.isArray = function(arg) {
          return Object.prototype.toString.call(arg) === '[object Array]';
        };
      }

      $(document).ready(function () {
        var data = {
          '_x33_.1': [
            'C-2 CU',
            '7.1',
            [
              'Bed and breakfast',
              'Bed and breakfast with open dining',
            ],
            [
              'Forestry',
              'Condominiums',
            ],
          ],
          '_x32_.1': [
            'C-2 CU',
            '4.1',
            [
              'Agricultural production',
            ],
            [
              'Forestry',
            ],
          ],
        };

        var map = $('#map');
        var mapInfoFields = $('#mapInfo .map-info-field');
        var $selected = null;

        map.on('click', 'path', function (event) {
          var $target = $(event.currentTarget);
          // jQuery can't manipulate class for svg elements (!!)
          if ($target.attr('class')) {
            $selected.attr('class', '');
            $selected = null;
          } else {
            if ($selected) { $selected.attr('class',''); }
            $selected = $target;
            $selected.attr('class', 'selected');
          }
        });

        map.on('mouseenter', 'path', function (event) {
          if ($selected) { return; }
          var section = event.currentTarget.parentNode.id;
          var datum = data[section];
          if (!section || !datum) { return; }
          mapInfoFields.each(function (i, elem) {
            var $elem = $(elem);
            var d = datum[i];
            if (!Array.isArray(d)) {
              $elem.text(datum[i]);
            } else {
              $elem.html('');
              var lis = [];
              $.each(d, function (j, part) {
                var $li = $('<li>');
                $li.text(part);
                lis.push($li);
              });
              $elem.append(lis);
            }
          });
        });
      });
    })(jQuery);
    </script>
